  [],\n\t\"title\": \"Digitized Shoreline from Approximately 1950, 1980, and 2003
  for the Coastal Areas of Bering Land Bridge NP (BELA) and Cape Krusenstern NM (CAKR),
  Northwest Alaska\",\n\t\"tracking_summary\": {\n\t\t\"total\": 72,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2013-03-15T10:41:07.414577\",\n\t\"name\": \"digitized-shoreline-from-approximately-1950-1980-and-2003-for-the-coastal-areas-of-bering-land-f6788\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This file geodatabase contains the digitized
  shorelines for Cape Krusenstern from approximately 1950, 1980, and 2003 as feature
  classes. Each feature class contains detailed pertinent metadata. The following
  information pertains to the 1980 feature class. This shoreline reference feature
  is defined as the waterline and was digitized onscreen from orthorectified aerial
  photography from approximately 1980 for the coastal areas of Bering Land Bridge
  National Preserve (BELA), Cape Krusenstern National Monument (CAKR), and nearby
  portions of northwestern Alaska. The aerial photography frames are derived from
  1:64,000-scale, color-infrared (CIR) photographs acquired by the USGS and NOAA from
  1978 to 1985. These images and the companion shoreline were completed as part of
  a study on coastal erosion in collaboration between the University of Colorado (Institute
  of Arctic and Alpine Research) and the National Park Service (Arctic Network Inventory
  and Monitoring Program). The shoreline has a total length of approximately 480 km.
  Shoreline error was calculated using the square root of the sum of the squares (SRSS)
  calculation of the orthorectification and digitization errors. Errors for the approximately
  1980s shorelines are 2.8 m for BELA and 2.2 m for CAKR. The shoreline is available
  in ArcGIS geodatabase format. It has a UTM zone 3 projection and NAD83 datum, with
  FGDC-compliant metadata. Attribute information in the feature class table includes,
  frame number, acquisition date, comments, and line length. The geodatabase is available
  through an unrestricted public license, and can be obtained online by request (see
  Distributor contact information below). Other data available in this series includes
  Bluff-Top coastlines and Digital Shoreline Analysis System (DSAS) files. Together,
  the data will be of interest to land managers, scientists, and others for observation
  and analysis of natural features and ecosystems.\",\n\t\"license_title\": null,\n\t\"extras\":
